all-section-image-container landing-lesson-intro__small-section-image"><img src="https://d2aj9sy12tbpym.cloudfront.net/javascripts/dist/assets/path_image_id-00de898f37d3fef9bc99ed6d8316dab8.png"></div><h3 class="landing-heading landing-lesson-intro__small-section-title right-spacer">Pembelajaran Secara Terpandu</h3><p class="landing-body-text landing-lesson-intro__small-section-text right-spacer"><span>Ikuti serangkaian pelajaran yang disusun secara optimal untuk membantu Anda menjadi seorang kreator sejati.<br class="sp">Setelah selesai, Anda dapat menjadi coder dengan pengetahuan yang luas untuk mencapai cita-cita Anda secara mandiri.</span></p></div></div><div class="landing-container success-story__main"><h2 class="landing-heading success-story__main-title">Kisah Sukses</h2><p class="landing-body-text success-story__main-subtitle">Bacalah kisah penuh inspirasi tentang kesuksesan para pelajar kami dari seluruh belahan dunia.</p><div class="success-story__main-list"><a class="landing-success-story-card__link" href="success_stories/ymihashi-id"><div class="landing-success-story-card__main"><div class="landing-success-story-card__icon-container"><img class="landing-success-story-card__icon" src="https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/success_story/ymihashi-id/profile_image/1584593813722.jpg"></div><p class="landing-success-story-card__summary">Perjalanan Anak Usia 15 Tahun dari Programming Scratch Ke Super Creator</p><div class="landing-success-story-card__info"><p class="landing-success-story-card__user-name">Yuki Mihashi</p><p class="landing-success-story-card__country-name">Jepang</p></div></div></a><a class="landing-success-story-card__link" href="success_stories/rhythmv-id"><div class="landing-success-story-card__main"><div class="landing-success-story-card__icon-container"><img class="landing-success-story-card__icon" src="https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/success_story/rhythmv-id/profile_image/1584593400936.j